            <Text style={styles.Txt497}>SamIAm</Text>
          </View>
          <Image
            style={styles.Share}
            source={{
              uri: "https://firebasestorage.googleapis.com/v0/b/unify-bc2ad.appspot.com/o/dxsfpg8kia9-21%3A72?alt=media&token=f44070ea-90b3-4ca4-8c7c-9fa2f1341ef6",
